import '../assets/css/Module.css';

document.title = data.title

function App({data}) {
  if (data === undefined) {

    document.title = "No Module";

    return (
      <h1>
        Non existing module was called for.
      </h1>
    )
  }

  return (
    <div className="Module">
      <h1>{ data.title }</h1>
      {data.elements.map( (a, b) => {
        return a
      })}
    </div>
  );
}

export default App;
